import { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './App.css';

function App() {
  const [url, setUrl] = useState('');

  const navigate = useNavigate();

  const submitUrl = (e) => {
    e.preventDefault();
    navigate('/test');
  };

  const renderSearchBar = () => {
    return (
      <div>
        <input
          type='text'
          value={url}
          onChange={(e) => {
            setUrl(e.target.value);
          }}
          placeholder='Paste listing URL'></input>
        <button
          type='submit'
          onClick={(e) => {
            submitUrl(e);
          }}>
          Submit
        </button>
      </div>
    );
  };

  return (
    <div className='App'>
      {renderSearchBar()}
      {}
    </div>
  );
}

export default App;
